import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Categories from '../components/cards/Categories';
import axios from 'axios';

function Welcome() {
  const [showProfile, setShowProfile] = useState(false);
  const [user, setUser] = useState(null);
  const [editMode, setEditMode] = useState(false);
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    role: ''
  });

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const token = localStorage.getItem('token');
        const response = await axios.get('https://localhost:7029/Admin/Profile', {
          headers: {
            Authorization: `Bearer ${token}`
          }
        });
        setUser(response.data);
        setFormData({
          username: response.data.username,
          email: response.data.email,
          role: response.data.role
        });
      } catch (error) {
        console.error('Error fetching profile:', error);
      }
    };

    if (showProfile) {
      fetchProfile();
    }
  }, [showProfile]);

  const handleLogout = () => {
    localStorage.removeItem('token');
    window.location.href = '/login';
  };

  const handleEdit = () => {
    setEditMode(true);
  };

  const handleSave = async () => {
    try {
      const token = localStorage.getItem('token');
      await axios.put('https://localhost:7029/Admin/UpdateProfile', formData, {
        headers: {
          Authorization: `Bearer ${token}`
        }
      });
      setUser(formData);
      setEditMode(false);
      alert('Profile updated successfully');
    } catch (error) {
      console.error('Error updating profile:', error);
      alert('Failed to update profile');
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value
    }));
  };

  return (
    <div className="container mt-4">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Welcome to the Shopping App</h2>
        <div>
          <button className="btn btn-primary me-2" onClick={() => setShowProfile(!showProfile)}>
            {showProfile ? 'Home' : 'My Profile'}
          </button>
          <button className="btn btn-danger" onClick={handleLogout}>
            Logout
          </button>
        </div>
      </div>

      {showProfile && user ? (
        <div className="card p-4 shadow-sm">
          <h3 className="mb-3">Admin Profile</h3>
          <div className="mb-3">
            <label className="form-label">Username</label>
            {editMode ? (
              <input
                type="text"
                className="form-control"
                name="username"
                value={formData.username}
                onChange={handleChange}
              />
            ) : (
              <p>{user.username}</p>
            )}
          </div>

          <div className="mb-3">
            <label className="form-label">Email</label>
            {editMode ? (
              <input
                type="email"
                className="form-control"
                name="email"
                value={formData.email}
                onChange={handleChange}
              />
            ) : (
              <p>{user.email}</p>
            )}
          </div>

          <div className="mb-3">
            <label className="form-label">Role</label>
            <p>{user.role}</p>
          </div>

          {editMode ? (
            <button className="btn btn-success" onClick={handleSave}>
              Save
            </button>
          ) : (
            <button className="btn btn-warning" onClick={handleEdit}>
              Edit
            </button>
          )}
        </div>
      ) : (
        <Categories />
      )}
    </div>
  );
}

export default Welcome;
